<section class="blog">
  <div class="container">

    <div class="blog__wrapper">

      <?php
      $title = get_sub_field('blog_title');
      ?>
      <?php if ($title) : ?>
        <h2 class="blog__title section__title">
          <?= $title; ?>
        </h2>
      <?php endif; ?>
      <div class="blog__category">
        <ul id="category-filter">
          <li data-category="all" class="active">
            <?php pll_e('Все'); ?>
          </li>
          <?php

          $categories = get_terms(
            array(
              'taxonomy' => 'category',
              'hide_empty' => false,
              'exclude' => array(get_cat_ID('Uncategorized')),
            )
          );

          foreach ($categories as $category) {
            if ($category->count > 0) {
              $category_slug = rawurlencode($category->slug);
              echo '<li data-category="' . $category_slug . '">' . esc_html($category->name) . '</li>';
            }
          }



          ?>
        </ul>
        <div class="archive-blogs__select custom-select">

          <select id="archive-blogs__select-category" class="tabs-select" style="display: none;">
            <option value="all">
              <?php pll_e('Все'); ?>
            </option>
            <?php

            $categories = get_terms(
              array(
                'taxonomy' => 'category',
                'hide_empty' => false,
                'count' => true,
              )
            );
            foreach ($categories as $category) {
              if ($category->count > 0) {
                echo '<option value="' . esc_attr($category->slug) . '">' . esc_html($category->name) . '</option>';
              }
            }
            ?>
          </select>
        </div>
        <div class="blog__count">
          <?php
          $count_text = get_sub_field('blog_count') ?? '';
          $current_language = pll_current_language();
          $total_posts = pll_count_posts($current_language);
          echo '(' . $total_posts . ')';
          ?>
          <p>
            <?= $count_text ?>
          </p>
        </div>
        <div class="blog__select blog-select">
          <span>
            <?php pll_e('Сортировать:') ?>
          </span>
          <select id="blogs__select" class="tabs-select">
            <option value="popular">
              <?php pll_e('Популярные'); ?>
            </option>
            <option value="new">
              <?php pll_e('Новые'); ?>
            </option>
            <option value="az">
              <?php pll_e('От А-Я'); ?>
            </option>
          </select>
        </div>

      </div>

